Hanna Montada se ha levantado hoy con ganas de chupar. Le abrimos las puertas de la Villa y la vemos chupando una piruleta. Eso no puede ser. Asi que decidimos darle una enorme sorpresa. Pero para estar seguros de que sera de su gusto, haremos la prueba del vaso. Aunque conociendo a Nick Moreno, la prueba esta mas que superada...
